import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header style={{ backgroundColor: "#4CAF50", color: "white", padding: "10px", textAlign: "center" }}>
      <h1>My Portfolio</h1>
      <nav>
        <Link to="/" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>Home</Link>
        <Link to="/blog" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>Blog</Link>
        <Link to="/news" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>News</Link>
        <Link to="/projects" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>Projects</Link>
        <Link to="/about" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>About</Link>
        <Link to="/login" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>Login</Link>
        <Link to="/register" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>Register</Link>
      </nav>
    </header>
  );
};

export default Header;
